style.css:
@-moz-document domain("www.roblox.com"), domain("forum.roblox.com") {
#rplusNavItem {
    width: 30px !important;
    height: 30px !important;
    float: right;
  }
  
  #game-detail-page {
    width: 970px !important;
  }
  
  #game-detail-page .voting-panel {
    visibility: hidden !important;
  }
  
  #game-detail-page .game-calls-to-action {
    position: absolute !important;
    top: 0px !important;
    left:0px !important;
    width: 100% !important;
  }
  
  #game-detail-page .game-play-buttons {
    position: absolute !important;
    left: 1% !important;
    top: calc(375px + 25%) !important;
    width: 60% !important;
    height: 72px !important; 
    background-color: #CCCCCC !important;
    border-color: #96B49C !important;
    border-style: dotted !important;
    border-width: 2px !important;
  }
  
  #game-detail-page .game-stats-container {
    position: absolute !important;
    top: -630px;
    left: 61.5%;
    width: 37.5% !important;
    background-color: white;
    border-color: #c2c2c2;
    border-width: 2px;
    border-style: dotted;
    padding-top: 25px !important;
    padding-bottom: 205px !important;
    z-index: 0 !important;
    padding-left: 4px !important;
    visibility: visible !important;
    display: block !important;
  }
  
  #game-detail-page #about .game-about-container .game-description {
    position: absolute !important;
    left: 62.5%;
    top: -430px !important;
    width: 35.5% !important;
    height: 190px !important;
    overflow-y: scroll !important;
    z-index: 2 !important;
    display: block !important;
    border-color: black;
    border-width: 1px;
    border-style: solid;
  } 
  
  #game-detail-page .game-stats-container .game-stat .text-label::after {
    content: ": ";
    margin-right: 5px;
  }
  
  #game-detail-page .game-stats-container .game-stat .text-lead {
    font-size: 16px !important;
  }
  
   #game-detail-page .game-stats-container .game-stat {
    float: none !important;
    width: 100% !important;
    height: 27px !important;
  }
  
  #game-detail-page .game-stats-container .game-stat p{
    float: left !important;
  }
  
  #game-detail-page .icon-favorite {
    width: 100% !important;
    height: 100% !important;
    left: 0px !important;
    position: absolute !important;
    z-index: 1 !important;
    display: block !important;
    opacity: 0 !important;
  }
  
  #game-detail-page .favorite-button-container {
    position: absolute !important;
    top: calc(340px + 20%) !important;
    width: 60% !important;
    left: 1% !important;
    background-color: white !important;
    border-color: #c2c2c2;
    border-width: 2px;
    border-style: dotted;
    border-top-style: none !important;
  }
  
  #game-detail-page .favorite-button-container .text-favorite {
    text-align: center !important;
    color: black !important;
    float: none !important;
    display: block !important;
    z-index: 0 !important;
    font-size: 0px !important;
  }
  
  #game-detail-page .favorite-button-container .text-favorite::after {
    content: "Favorite";
    font-size: 16px !important;
  }
  
  #game-detail-page .favorite-button-container a {
    text-align: center !important;
  }
  
  #game-detail-page #rbx-carousel {
    position: absolute !important;
    top: calc(40px + 1vw) !important;
    left: 1% !important;
    width: 60% !important;
    height: 300px !important;
    overflow: hidden !important;
    border-color: black;
    border-style: solid;
    border-width: 1px;
    border-bottom-style: none;
  }
  
  .game-main-content {
    padding: 0px;
    border-width: 1px;
    border-color: black;
    border-style: solid;
    border-bottom-style: none !important;
    height: 600px !important;
    background-color: #EEEEEE !important;
  }
  
  .game-main-content::after {
    content: "This release of 'ROBLOX 2009' is a beta, check back on the userstyles.org website for updates weekly :)";
    text-align: center;
    font-size: 16px;
    right: 10%;
    position: fixed;
    top: 0px;
    left: 10%;
    z-index: 99999;
    display: block !important;
    background-color: red;
    color: white;
    padding: 1%;
  }
  
  #game-detail-page .game-creator {
    position: absolute !important;
    width: 37% !important;
    overflow: hidden !important;
    left: 62% !important;
    top: 62px !important;
    z-index: 1 !important;
    display: block !important;
  }
  
  #game-detail-page .game-creator .text-label {
    font-size: 0px;
  }
  
  #game-detail-page .game-creator .text-label::after {
    content: "Creator: ";
    font-size: 16px !important;
  }
  
  #game-detail-page .game-title-container {
    background-color: #CCCCCC !important;
  }
  
  #game-detail-page .game-title-container {
    height: auto !important;
    left: 0px !important;
    top: 0px !important;
    width: 100% !important;
    position: absolute !important;
    border-bottom-width: 1px;
    border-color: black;
    border-bottom-style: solid;
  }
  
  #game-detail-page .game-name {
    text-align: center !important;
    font-family: "Comic Sans MS" !important;
  }
  
  .rbx-text-overflow::after {
    background-image: none !important;
  }
  
  .rbx-alert-info {
    position: fixed;
    bottom: 0px;
    width: 100%;
    z-index: 1 !important;
  }
  
  .games-page-right-sidebar, .abp-spacer, .ad-annotations, .ad-slot, .in-game-search-ad, #AdvertisingLeaderboard {
    visibility: hidden !important;
    position: fixed !important;
    left: 0px !important;
    z-index: -1 !important;
  }
  
  .roblox-messages-container {
    margin-top: 20px;
  }
  
  #navigation #rbx-scrollbar, #navigation #rbx-scrollbar #mCSB_1 {
    height: 40px !important;
    visibility: visible !important;
  }
  
  #navigation mCSB_1_container {
    height: 40px !important;
  }
  
  #GamesPageLeftColumn {
    margin-right: 0px !important;
    width: 99% !important;
  }
  
  #mCSB_1 {
    overflow: hidden !important;
    margin-top: 3px;
  }
  
  .page-content {
    margin-left: calc(50% - 485px);
  }
  
  iframe[height*="600"] {
    visibility: hidden !important;
  }
  
  #navContent {
    overflow: hidden !important;
  }
  
  .game-play-buttons {
    padding-left: 0px !important;
  }
  
  #MultiplayerVisitButton {
    position: absolute !important;
    width: 250px !important;
    height: 48px !important;
    border-radius: 10px !important;
    background-image: URL("http://community.roblox.com/wp-content/uploads/2009/07/profile-status-update.jpg");
    background-position: -476px -475px; 
    cursor: pointer;
    left: calc(50% - 125px) !important;
    top: 10px !important;
  }
  
  #MultiplayerVisitButton:hover {
    filter: brightness(110%);
  }
  
  #MultiplayerVisitButton a {
    font-size: 0px !important;
    background-color: transparent !important;
    border-color: transparent !important;
    visibility: hidden !important;
  }
  
  #nav-settings, .navbar-right li a[data-bind*="popover-setting"] {
    position: fixed !important;
    left: 5px !important;
    top: 5px !important;
    float: none !important;
  }
  
  .navbar-right li a[data-bind*="popover-tix"] {
    padding: 0px !important;
  }
  
  .navbar-right li a[data-bind*="popover-robux"] {
    padding: 0px !important;
  }
  
  .navbar-right {
    background-color: white;
    margin: 5px;
    margin-top: calc(3.5% - 30px);
    height: 60px !important;
    border-color: black;
    border: solid 1px;
    width: 200px;
    color: black;
  }
  
  #nav-tix-amount, #nav-robux-amount {
    color: orange;
    font-family: Arial;
    font-size: 12px;
  }
  
  #nav-robux-amount {
    color: green;
  }
  
  
  #nav-robux-amount::after {
    content: " ROBUX";
  }
  
  #nav-robux {
    background-image: URL("https://dl.dropboxusercontent.com/s/vj1hbj1e1i5al02/Robux.png");
    background-position: center center;
  }
  
  #nav-tix {
    background-image: URL("https://dl.dropboxusercontent.com/s/d6jwd3se8z53ekj/Tx_enhanced.png");
    background-position: center center;
  }
  
  #nav-tix-amount::after {
    content: " Tickets";
  }
  
  #MasterContainer {
    margin-top: 100px;
  }
  
  .card-item, .rbx-game-title {
    font-size: 14px !important; 
    color: blue;
    font-weight: 500;
    background-color: transparent !important;
    border: none !important;
    box-shadow: none !important;
    text-decoration: none;
  }
  
  .card-item:hover, .rbx-game-title:hover {
    text-decoration: underline !important;
  }
  
  .rbx-icon-thumbs-down {
    visibility: hidden;
  }
  
  .rbx-developer {
    visibility: visible !important;
    display: block !important;
    top: 0px !important;
    margin-top: 0px !important;
    background-color: transparent !important;
    background: none !important;
    border: none !important;
  }
  
  .vote-bar, .vote-counts {
    visibility: hidden !important;
    position: fixed !important;
    z-index: -1 !important;
  }
  
  .rbx-game-text-notes {
    color: red !important;
  }
  
  .rbx-nav-collapse {
    visibility: hidden !important;
    width: 0px !important;
  }
  
  .rbx-navbar:hover {
    background-color: transparent !important;
  }
  
  a:hover {
    background-color: transparent !important;
    text-decoration: underline !important;
  }
  
  body {
    background-image: url("http://img13.deviantart.net/e99a/i/2013/314/9/1/summer_clouds__psd__by_macsix-d6trrl1.png");
    background-size: auto 100%;
  }
  
  #navbar-universal-search {
    visibility: hidden !important;
    width: 0px !important;
    margin: 0px !important;
    padding: 0px !important;
    z-index: -1 !important;
    position: fixed !important;
  }
  
  .navbar-brand, .rbx-nav-notification, .rbx-icon-nav-menu, .rbx-nav-collapse, .rbx-navbar-header {
    visibility: hidden;
    width: 0px !important;
    margin: 0px !important;
    padding: 0px !important;
  }
  
  #header {
    left: 10% !important;
    right: 10% !important;
    height: 6vw !important;
    background-image: url("https://dl.dropboxusercontent.com/s/rjjsu4x14gc4pka/olddesignnew.png");
    background-size: 100% auto;
    background-repeat: no-repeat;
    position: absolute !important;
    z-index: 1000 !important;
  }
  
  .content {
    margin-top: 6%;
    margin-right: 10% !important;
    margin-left: 10% !important;
    width: 80% !important;
    max-width: none !important;
    float: left !important;
  }
  
  .container-footer {
    position: absolute;
    top: none !important;
    left: 100px !important;
    right: 100px !important;
    width: auto !important;
  }
  
  #navigation {
    position: absolute !important;
    font-family: "Comic Sans MS", "Arial";
    background-color: #6F99CB;
    color: white !important;
    
    height: 40px;
    left: 10% !important;
    right: 10% !important;
    top: 6vw;
    
    overflow: hidden !important;
  }
  
  #navigation > ul {
    visibility: hidden !important;
    position: fixed !important;
  }
  
  #navigation div {
    visibility: visible !important;
  }
  
  #navigation .rbx-scrollbar {
    overflow: visible !important;
  }
  
  .nav {
    font-family: "Comic Sans MS", "Arial" !important;
    z-index: 2 !important;
    top: calc(6vw + 2px);
    margin: 0px !important;
    left: calc((50% - 455px) + 120px) !important;
    line-height: none !important;
    width: 280px;
    
  }
  
  .rbx-navbar {
    position: absolute;
  }
  
  .nav li a {
    margin-left: 8px !important;
    margin-right: 8px !important;
    display: inline-block !important;
  }
  
  .nav li {
    width: auto !important;
  }
  
  .buy-robux {
    position: fixed !important;
    visibility: hidden !important;
    z-index: -1 !important;
  }
  
  #nav-home, #nav-profile, #nav-friends, #nav-character, #nav-inventory, #nav-trade, #nav-group, #nav-forum, #nav-blog, #nav-shop {
    color: white;
    float: left;
    padding-left: 10px;
    padding-right: 10px;
  }
  
  #nav-profile {
    font-size: 0px !important;
    min-width: 94px !important;
    margin-right: 160px;
  }
  
  #nav-profile span::after {
    content: "My ROBLOX" !important;
    font-size: 16px !important;
  }
  
  #nav-home:hover, #nav-profile:hover, #nav-message:hover, #nav-friends:hover, #nav-character:hover, #nav-inventory:hover, #nav-trade:hover, #nav-group:hover, #nav-forum:hover, #nav-blog:hover, #nav-shop:hover {
    color: white !important;
    text-decoration: underline !important;
  }
  
  #mCSB_1_container ul li a:hover {
    color: white !important;
    text-decoration: underline !important;
  }
  
  #nav-message, #nav-friends {
    transition: background-color 0.5s, left 0.5s;
    opacity: 1;
    z-index: 2000 !important;
    position: fixed !important;
    left: -80px;
    color: black;
    top: 0px !important;
    width: 110px;
    text-align: left !important;
    padding: 0px !important;
  }
  
  #nav-friends {
    top: 40px !important;
  }
  
  #nav-message:hover, #nav-friends:hover {
    left: 0px;
    background-color: black !important;
  }
  
  #nav-character {
    margin-left: 100px
  }
  
  .icon-nav-home, .icon-nav-profile, .icon-nav-message, .icon-nav-friends, .icon-nav-charactercustomizer, .icon-nav-inventory, .icon-nav-trade, .icon-nav-group, .icon-nav-forum, .icon-nav-blog, .icon-nav-shop, #nav-shop {
    width: 0px !important;
    visibility: hidden !important;
  }
  
  .game-item .rbx-votes {
    visibility: hidden !important;
    position: fixed !important;
    left: -100% !important;
  }
  
  .rbx-left-col, .rbx-scrollbar, #mCSB_1_container {
    width: auto !important;
  }
  
  #mCSB_1_container {
    width: 900px !important;
    margin-left: calc(50% - 450px);
    top: 0px !important;
    overflow: visible !important;
  }
  
  #mCSB_1_container ul {
    overflow: visible !important;
  }
  
  mCSB_1_container ul li {
    overflow: visible !important;
  }
  
  .rbx-upgrade-now, .rbx-nav-sponsor, #nav-home, .rbx-text-notes {
    position: fixed !important;
    left: -100% !important;
    z-index: -1 !important;
    visibility: hidden !important;
    margin: 0px !important;
  }
  
  #nav-blog {
    font-size: 0px !important;
    margin-top: 6px;
  }
  
  #nav-blog::after {
    content: "News";
    font-size: 16px;
    margin-top: 15px !important;
  }
  
  #navigation ul .rbx-lead {
    position: absolute !important;
    z-index: 100 !important;
    top: 0px !important;
    overflow: visible !important;
  }
  
  li {
    margin-top: 0px !important;
    margin-bottom: 0px !important;
  }
  
  ul {
    padding: 0px !important;
  }
}
